import { MDBBtn } from "mdb-react-ui-kit";

const QuickBtn = ({label})=>{
    return(
    <>
        <MDBBtn floating></MDBBtn>
        <p>{label}</p>
    </>
    );
}

export default function Project(){
    return(
    <>
        <div>
            <div className="quickAdd">
                <QuickBtn label="estimate"/>
                <QuickBtn label="Invoice"/>
                <QuickBtn label="estimate"/>
            </div>
        </div>
    </>
    );
}
